import React, {useState} from 'react';
import './Home.css';
import {useNavigate} from 'react-router-dom';

const setBtn=(props)=>{
  <div>
    <input className={props.i} type='radio' value={props.one}></input>
    <p></p>
    <input className={props.i} type='radio' value={props.two}></input>
  </div>
}
function Home(){ 
    const navigate = useNavigate();
    const mbti= [
      ["E","I"],
      ["S","N"],
      ["T","F"],
      ["J","P"]
    ];
    const mean = ["에너지 방향","인식 방식", "판단", "생활 양식"];

    return (
      <div className="Home">
        <div className="upperTitle">
          <p>MBTI</p>
          <button onClick={()=>navigate('/admin')}>
            관리자 페이지</button>
        </div>

        <div className="chooseMbti">
          {mbti.map((a,i)=>{
                <setBtn one={a[0]} two={a[1]} name={i} />
            })}

           <div className="completeBtn">
              <input type='submit' value={"확인"} onClick={()=>{navigate('/result');}}/>
           </div>
        </div>

        <div className="lowerTitle"></div>
      </div>
    );
};

export default Home;
